// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Header from './Components/Header';
import LastPredictions from './Components/LastPredictions';
import MatchList from './Components/MatchList';
import Footer from './Components/Footer';
import MatchesPage from './Components/MatchesPage'; // Yeni eklenen sayfa

const App = () => {
  return (
    <Router>
      <div className="App">
        <Header />
        <Routes>
          <Route path="/" exact>
            {/* Ana sayfa bile≈üenleri */}
            <LastPredictions />
            <MatchList />
          </Route>
          <Route path="/matches" component={MatchesPage} /> {/* Yeni eklenen sayfa */}
        </Routes>
        <Footer />
      </div>
    </Router>
  );
};

export default App;
